contracts/RootRegistry.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity 0.8.20;

import "@layerzerolabs/solidity-examples/contracts/lzApp/NonblockingLzApp.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableMap.sol";
import "./IERC20.sol";

contract RootRegistry is NonblockingLzApp {
    uint8 constant PT_REGISTER = 0;
    uint8 constant PT_INVEST = 1;

    using EnumerableMap for EnumerableMap.AddressToUintMap;

    struct Round {
        uint256 startTime;
        uint256 endTime;
        uint256 fundingDemand;
        uint256 totalTicket;
    }

    struct Project {
        address tick;
        address owner;
        Round[] rounds;
        uint256 changeFee;
    }

    struct Investor {
        address investor;
        uint256 amount;
    }

    uint256 projectIndex;
    IERC20 public token;
    uint256 public immutable lzChainId;

    mapping(bytes32 => Project) interchainProjects;
    mapping(bytes32 => mapping(uint8 => uint256)) roundTicketBought;
    mapping(bytes32 => mapping(uint8 => EnumerableMap.AddressToUintMap)) projectInvestors;

    modifier validRound(bytes32 _projectId, uint _roundIndex) {
        require(
            interchainProjects[_projectId].owner != address(0),
            "Invalid projectId"
        );
        require(
            interchainProjects[_projectId].rounds.length > _roundIndex,
            "Invalid roundIndex"
        );
        require(
            interchainProjects[_projectId].rounds[_roundIndex].startTime <
                block.timestamp,
            "Round not open for invest yet"
        );
        require(
            interchainProjects[_projectId].rounds[_roundIndex].endTime >
                block.timestamp,
            "Round has ended"
        );
        _;
    }

    event ProjectCreated(bytes32 projectId, address owner, uint numberOfStage);
    event ProjectInvested(
        bytes32 projectId,
        address investor,
        uint round,
        uint256 amountOfTicket
    );

    constructor(
        address _endpoint,
        address _owner,
        uint256 _lzChainId,
        address _token
    ) NonblockingLzApp(_endpoint) Ownable(_owner) {
        lzChainId = _lzChainId;
        token = IERC20(_token);
    }

    function setToken(address _token) external onlyOwner {
        token = IERC20(_token);
    }

    function withdraw() external onlyOwner {
        payable(owner()).transfer(token.balanceOf(address(this)));
    }

    function createProject(
        address _owner,
        address _tick,
        Round[] memory _rounds,
        uint256 _changeFee
    ) public onlyOwner {
        bytes32 projectId = keccak256(
            abi.encodePacked(lzChainId, projectIndex)
        );
        for (uint i = 0; i < _rounds.length; i++) {
            Round storage _round = interchainProjects[projectId].rounds.push();
            _round.startTime = _rounds[i].startTime;
            _round.endTime = _rounds[i].endTime;
            _round.fundingDemand = _rounds[i].fundingDemand;
            _round.totalTicket = _rounds[i].totalTicket;
        }
        interchainProjects[projectId].changeFee = _changeFee;
        interchainProjects[projectId].owner = _owner;
        interchainProjects[projectId].tick = _tick;
        projectIndex += 1;
        emit ProjectCreated(projectId, _owner, _rounds.length);
    }

    function getTicketValue(
        bytes32 _projectId,
        uint _round
    ) public view validRound(_projectId, _round) returns (uint256) {
        return
            interchainProjects[_projectId].rounds[_round].fundingDemand /
            interchainProjects[_projectId].rounds[_round].totalTicket;
    }

    function getInvestingProgress(
        bytes32 _projectId,
        uint8 _round
    ) public view validRound(_projectId, _round) returns (uint256, uint256) {
        return (
            roundTicketBought[_projectId][_round] *
                getTicketValue(_projectId, _round),
            interchainProjects[_projectId].rounds[_round].fundingDemand
        );
    }

    function getRoundInvestors(
        bytes32 _projectId,
        uint8 _round
    ) public view validRound(_projectId, _round) returns (Investor[] memory) {
        uint investorCount = projectInvestors[_projectId][_round].length();
        Investor[] memory investors = new Investor[](investorCount);
        for (uint i = 0; i < investorCount; i++) {
            (address _investor, uint256 _amount) = projectInvestors[_projectId][
                _round
            ].at(i);
            investors[i] = Investor(_investor, _amount);
        }
        return investors;
    }

    function investProject(
        bytes32 _projectId,
        uint8 _round,
        uint256 _amountOfTicket
    ) public validRound(_projectId, _round) {
        require(
            roundTicketBought[_projectId][_round] + _amountOfTicket <=
                interchainProjects[_projectId].rounds[_round].totalTicket,
            "Exceed ticket amount"
        );
        Project memory project = interchainProjects[_projectId];
        uint256 payingAmount = _amountOfTicket *
            getTicketValue(_projectId, _round);
        require(
            token.transferFrom(msg.sender, address(this), payingAmount),
            "Transfer token failed"
        );

        roundTicketBought[_projectId][_round] += _amountOfTicket;
        token.transfer(
            project.owner,
            (payingAmount * (100 - project.changeFee)) / 100
        );

        if (projectInvestors[_projectId][_round].contains(msg.sender)) {
            projectInvestors[_projectId][_round].set(
                msg.sender,
                projectInvestors[_projectId][_round].get(msg.sender) +
                    _amountOfTicket
            );
        } else {
            projectInvestors[_projectId][_round].set(
                msg.sender,
                _amountOfTicket
            );
        }
    }

    function createProjectInterchain(
        bytes32 _projectId,
        address _owner,
        address _tick,
        Round[] memory _rounds,
        uint256 _changeFee
    ) internal {
        for (uint i = 0; i < _rounds.length; i++) {
            Round storage _round = interchainProjects[_projectId].rounds.push();
            _round.startTime = _rounds[i].startTime;
            _round.endTime = _rounds[i].endTime;
            _round.fundingDemand = _rounds[i].fundingDemand;
            _round.totalTicket = _rounds[i].totalTicket;
        }
        interchainProjects[_projectId].changeFee = _changeFee;
        interchainProjects[_projectId].owner = _owner;
        interchainProjects[_projectId].tick = _tick;

        emit ProjectCreated(_projectId, _owner, _rounds.length);
    }

    function investProjectInterchain(
        address _owner,
        bytes32 _projectId,
        uint8 _round,
        uint256 _amountOfTicket,
        uint256 _ticketValue
    ) internal validRound(_projectId, _round) {
        require(
            _ticketValue == getTicketValue(_projectId, _round),
            "Invalid ticket value"
        );
        require(
            roundTicketBought[_projectId][_round] + _amountOfTicket <=
                interchainProjects[_projectId].rounds[_round].totalTicket,
            "Exceed ticket amount"
        );
        Project memory project = interchainProjects[_projectId];
        uint256 payingAmount = _amountOfTicket *
            getTicketValue(_projectId, _round);
        token.mint(
            project.owner,
            (payingAmount * (100 - project.changeFee)) / 100
        );
        token.mint(address(this), (payingAmount * project.changeFee) / 100);

        roundTicketBought[_projectId][_round] += _amountOfTicket;

        if (projectInvestors[_projectId][_round].contains(_owner)) {
            projectInvestors[_projectId][_round].set(
                _owner,
                projectInvestors[_projectId][_round].get(_owner) +
                    _amountOfTicket
            );
        } else {
            projectInvestors[_projectId][_round].set(
                msg.sender,
                _amountOfTicket
            );
        }
    }

    function _nonblockingLzReceive(
        uint16,
        bytes memory,
        uint64,
        bytes memory payload
    ) internal override {
        uint8 ptType;
        assembly {
            let length := mload(payload)
            ptType := mload(add(payload, 0x20))
        }
        if (ptType == PT_REGISTER) {
            (
                uint8 _type,
                bytes32 _projectId,
                address _owner,
                address _tick,
                Round[] memory _rounds,
                uint256 _changeFee
            ) = abi.decode(
                    payload,
                    (uint8, bytes32, address, address, Round[], uint256)
                );
            createProjectInterchain(
                _projectId,
                _owner,
                _tick,
                _rounds,
                _changeFee
            );
        } else if (ptType == PT_INVEST) {
            (
                uint8 _type,
                address _owner,
                bytes32 _projectId,
                uint8 _round,
                uint256 _amountOfTicket,
                uint256 _ticketValue
            ) = abi.decode(
                    payload,
                    (uint8, address, bytes32, uint8, uint256, uint256)
                );
            investProjectInterchain(
                _owner,
                _projectId,
                _round,
                _amountOfTicket,
                _ticketValue
            );
        } else {
            revert("Invalid packet");
        }
    }
}

